// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmSpinner 
} from '@vime/core';

import { define } from '../lib';


define('vm-spinner', VmSpinner);


export interface SpinnerProps extends JSX.VmSpinner, HTMLAttributes<HTMLVmSpinnerElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmSpinnerElement, SpinnerProps>(
  'vm-spinner',
  new Set(['isVideoView','currentProvider','showWhenMediaLoading','playbackReady','buffering']),
);
